import React from "react";
import "./footer.css";
import { Container, Row, Col } from "react-bootstrap";
import CryptoIcon from '../../../src/assets/crypto-ket.svg';
const Footer = () => {
  return (
    <Container>
      <Row>
        <Col sm={4}>
            <img src={CryptoIcon} alt="React Logo" /></Col>
        <Col sm={4}><span>Get The Latest Updates</span></Col>
        <Col sm={4}>sm=4</Col>
      </Row>
      <Row>
      <Col sm={8}>sm=8</Col>
      <Col sm={4}>sm=4</Col>
      </Row>
    </Container>
  );
};

export default Footer;
